import { useEffect, useState, useContext } from "react";
import { AuthContext } from "../Context/AuthContext";
import { Link } from "react-router-dom";
import Sidebar from "../Components/Sidebar";
import Navbar from "../Components/Navbar";
import api from "../api";

const UserDashboard = () => {
  const { user, logout } = useContext(AuthContext);
  const [stats, setStats] = useState({
    customers: 0,
    invoices: 0,
    leads: 0,
    inProgressLeads: 0,
  });

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const [custRes, invRes, leadRes] = await Promise.all([
          api.get("/customers"),
          api.get("/invoices"),
          api.get("/leads"),
        ]);

        const leads = leadRes.data.items || [];
        const inProgress = leads.filter(
          (l) => l.status === "Contacted" || l.status === "Qualified"
        ).length;

        setStats({
          customers: custRes.data.items.length || 0,
          invoices: invRes.data.items.length || 0,
          leads: leads.length,
          inProgressLeads: inProgress,
        });
      } catch (err) {
        console.error("Error fetching dashboard stats:", err.response?.data || err.message);
      }
    };
    fetchStats();
  }, []);

  return (
    <div className="flex h-screen bg-gray-100">
      {/* Sidebar */}
      <Sidebar />

      <div className="flex-1 flex flex-col">
        {/* Navbar */}
        <Navbar>
          <div className="flex items-center gap-4">
            <span className="text-gray-700 font-medium">Hi, {user?.username}</span>
            <button
              onClick={logout}
              className="bg-red-500 hover:bg-red-600 text-white px-3 py-1 rounded transition"
            >
              Logout
            </button>
          </div>
        </Navbar>

        {/* Dashboard Content */}
        <main className="p-6 flex-1 overflow-y-auto">
          <h1 className="text-3xl font-bold mb-6">Dashboard</h1>

          {/* Stats Cards */}
          <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-6 mb-6">
            {[
              { name: "Customers", value: stats.customers, link: "/customers", color: "blue" },
              { name: "Invoices", value: stats.invoices, link: "/invoices", color: "green" },
              { name: "Leads", value: stats.leads, link: "/leads", color: "yellow" },
              { name: "Leads In Progress", value: stats.inProgressLeads, link: "/leads", color: "purple" },
            ].map((card) => (
              <Link
                to={card.link}
                key={card.name}
                className={`bg-white p-6 rounded-lg shadow hover:shadow-lg transition cursor-pointer border-l-4 border-${card.color}-500`}
              >
                <h2 className="text-lg font-semibold">{card.name}</h2>
                <p className="text-2xl font-bold mt-2">{card.value}</p>
              </Link>
            ))}
          </div>

          {/* Quick Actions */}
          <div className="bg-white p-6 rounded-lg shadow">
            <h2 className="text-xl font-bold mb-4">Quick Actions</h2>
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4">
              <Link
                to="/customers/add"
                className="bg-blue-500 text-white p-4 rounded text-center hover:bg-blue-600 transition"
              >
                Add Customer
              </Link>
              <Link
                to="/invoices/add"
                className="bg-green-500 text-white p-4 rounded text-center hover:bg-green-600 transition"
              >
                Add Invoice
              </Link>
              <Link
                to="/leads/add"
                className="bg-yellow-500 text-white p-4 rounded text-center hover:bg-yellow-600 transition"
              >
                Add Lead
              </Link>
              <Link
                to="/customers"
                className="bg-gray-500 text-white p-4 rounded text-center hover:bg-gray-600 transition"
              >
                Manage Customers
              </Link>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default UserDashboard;
